import React, { useState } from 'react';
import { Box, Main, Heading, Paragraph, Collapsible, Grommet } from 'grommet';
import image from './A.png'

import AppBar from './components/AppBar'

// defines a theme as the global style to use for the entire page
const theme = {
  global: {
    colors: {
      brand: 'black',
      },
    font: {
      family: 'Roboto',
      size: '18px',
      height: '20px',
    },
  },
};

function App() {
  console.log(theme)

  return (
    <Grommet theme={theme} full>
        <AppBar/>

    </Grommet>
  );
}

export default App;
